import React, { Component } from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import "./Main.css";
import Home from "./components/home";
import Aboutus from "./components/aboutus";
import ContactUs from "./components/contact";
import Navbar from "./components/navbar";
import Result from "./components/result";
import SelectT from "./components/selectt";
import Survey from "./components/survey1";
import Login from "./components/login";
import fire from "./components/database";
import Sobhi from "./components/sobhi";
export default class MainPage extends Component {
  render() {
    return (
      <BrowserRouter>
        <div>
          <Navbar />
          <Switch>
            <Route path="/" component={Home} exact />
            <Route path="/Aboutus" component={Aboutus} />
            <Route path="/Contactus" component={ContactUs} />
            <Route path="/login" component={Login} />
            <Route path="/dev/sobhi" component={Sobhi} />
            }/>
            <Route path="/result" component={Result} />
            <Route path="/selecttemplate" component={SelectT} />
            }/>
            <Route path="/survey1" component={Survey} />
            }/>
            <Route
              path="/res/:name/:address/:phone/:pExp/:pLanguages/:skills"
              component={Result}
            />
            }/>
          </Switch>
        </div>
      </BrowserRouter>
    );
  }
}
